import 'whatwg-fetch';

class HttpService {
    getExpenses = () => {
        var promise = new Promise((resolve, reject) => {
            fetch('http://localhost:3004/expense').then(response => {
                resolve(response.json());
            })
        });
        return promise;
    }
}

export default HttpService;
